script: |
  super -f text -I q3323.spq | sort > q3323.out

inputs:
  - name: q3323.spq
    data: |
      SELECT ALL col0 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT BETWEEN - col1 + - + 98 * + + col2 AND - ( col2 ) * - col2 + - + col1;
  - name: tab1

outputs:
  - name: q3323.out
    data: |
